import React from "react";
import dynamic from "next/dynamic";

const DynamicComponentWithNoSSR = dynamic(
  () => import("../components/PdfView"),
  { ssr: false }
);

const Index = () => {
  return (
    <div>
      <h1>Hello</h1>

      <DynamicComponentWithNoSSR />
    </div>
  );
};

export default Index;
